import React, { PureComponent } from 'react';
import ResponsiveContainer from "react-responsive-widget";
import './App.css';
import {
  PieChart, Pie, Legend, Tooltip,
} from 'recharts';

const data01 = [
  { name: 'Ballons', value: 1000 }, { name: 'Géants', value: 700 },
  { name: 'Archer', value: 300 }, { name: 'Gobelin', value: 200 },
  { name: 'Dragon', value: 2000 }, { name: 'Gargouille', value: 100 },
];

const data02 = [
  { name: 'ggg', value: 1000 }, { name: 'Group B', value: 4567 },
  { name: 'Group C', value: 1398 }, { name: 'Group D', value: 9800 },
  { name: 'Group E', value: 3908 }, { name: 'Group F', value: 4800 },
];

export default class Ventes extends PureComponent {
  static jsfiddleUrl = 'https://jsfiddle.net/alidingling/k9jkog04/';

  render() {
    return (
            <PieChart width={400} height={300}>
              <Pie dataKey="value" isAnimationActive={false} data={data01} cx={150} cy={200} outerRadius={70} fill="#8884d8" label />
              <Pie dataKey="value" data={data02} cx={500} cy={200} innerRadius={40} outerRadius={80} fill="#82ca9d" />
              <Tooltip />
            </PieChart>
    );
  }
}
